DROP DATABASE IF EXISTS db_results;
CREATE DATABASE db_results;
CREATE SCHEMA db_results; 
-- CREATE TABLE db_results.lenex ("version" VARCHAR(25), "lenexid" INT NOT NULL,PRIMARY KEY ("lenexid"));
-- CREATE TABLE db_results.constructor ("name" VARCHAR(25), "registration" VARCHAR(50), "version" VARCHAR(25), "lenexid" INT, "constructorid" INT NOT NULL,PRIMARY KEY ("constructorid"));
-- CREATE TABLE db_results.contact ("name" VARCHAR(25), "street" VARCHAR(25), "city" VARCHAR(25), "zip" VARCHAR(25), "country" VARCHAR(25), "email" VARCHAR(25), "internet" VARCHAR(50), "constructorid" INT, "phone" VARCHAR(25), "street2" VARCHAR(25), "meetid" INT, "contactid" INT NOT NULL,PRIMARY KEY ("contactid"));
CREATE TABLE db_results.meet ("city" VARCHAR(25), "name" VARCHAR(50), "name.en" VARCHAR(75), "course" VARCHAR(25), "deadline" VARCHAR(25), "entrytype" VARCHAR(25), "number" VARCHAR(25), "organizer" VARCHAR(50), "organizer.url" VARCHAR(50), "result.url" VARCHAR(75), "startmethod" VARCHAR(25), "timing" VARCHAR(25), "type" VARCHAR(25), "withdrawuntil" VARCHAR(25), "nation" VARCHAR(25), "maxentriesathlete" VARCHAR(25), "lenexid" INT, "meetid" INT NOT NULL,PRIMARY KEY ("meetid"));
-- CREATE TABLE db_results.agedate ("value" VARCHAR(25), "type" VARCHAR(25), "meetid" INT, "agedateid" INT NOT NULL,PRIMARY KEY ("agedateid"));
CREATE TABLE db_results.pool ("name" VARCHAR(50), "lanemin" VARCHAR(25), "lanemax" VARCHAR(25), "meetid" INT, "poolid" INT NOT NULL,PRIMARY KEY ("poolid"));
-- CREATE TABLE db_results.facility ("city" VARCHAR(25), "name" VARCHAR(50), "nation" VARCHAR(25), "meetid" INT, "facilityid" INT NOT NULL,PRIMARY KEY ("facilityid"));
-- CREATE TABLE db_results.pointtable ("name" VARCHAR(50), "version" VARCHAR(25), "meetid" INT, "pointtableid" INT NOT NULL,PRIMARY KEY ("pointtableid"));
-- CREATE TABLE db_results.qualify ("from" VARCHAR(25), "until" VARCHAR(25), "meetid" INT, "qualifyid" INT NOT NULL,PRIMARY KEY ("qualifyid"));
CREATE TABLE db_results.session ("date" VARCHAR(25), "daytime" VARCHAR(25), "endtime" VARCHAR(25), "name" VARCHAR(25), "number" VARCHAR(25), "warmupfrom" VARCHAR(25), "warmupuntil" VARCHAR(25), "meetid" INT, "sessionid" INT NOT NULL,PRIMARY KEY ("sessionid"));
CREATE TABLE db_results.event ("daytime" VARCHAR(25), "gender" VARCHAR(25), "number" VARCHAR(25), "order" VARCHAR(25), "round" VARCHAR(25), "type" VARCHAR(25), "preveventid" VARCHAR(25), "sessionid" INT, "eventid" INT NOT NULL,PRIMARY KEY ("eventid"));
CREATE TABLE db_results.swimstyle ("distance" VARCHAR(25), "relaycount" VARCHAR(25), "stroke" VARCHAR(25), "eventid" INT, "swimstyleid" INT NOT NULL,PRIMARY KEY ("swimstyleid"));
-- CREATE TABLE db_results.fee ("currency" VARCHAR(25), "value" VARCHAR(25), "eventid" INT, "feeid" INT NOT NULL,PRIMARY KEY ("feeid"));
-- CREATE TABLE db_results.agegroup ("agemax" VARCHAR(25), "agemin" VARCHAR(25), "eventid" INT, "name" VARCHAR(25), "agegroupid" INT NOT NULL,PRIMARY KEY ("agegroupid"));
-- CREATE TABLE db_results.ranking ("order" VARCHAR(25), "place" VARCHAR(25), "resultid" VARCHAR(25), "agegroupid" INT, "rankingid" INT NOT NULL,PRIMARY KEY ("rankingid"));
-- CREATE TABLE db_results.heat ("number" VARCHAR(25), "order" VARCHAR(25), "status" VARCHAR(25), "eventid" INT, "daytime" VARCHAR(25), "heatid" INT NOT NULL,PRIMARY KEY ("heatid"));
CREATE TABLE db_results.club ("type" VARCHAR(25), "code" VARCHAR(25), "nation" VARCHAR(25), "region" VARCHAR(25), "swrid" VARCHAR(25), "name" VARCHAR(50), "shortname" VARCHAR(25), "meetid" INT, "name.en" VARCHAR(25), "clubid" INT NOT NULL,PRIMARY KEY ("clubid"));
CREATE TABLE db_results.athlete ("firstname" VARCHAR(25), "lastname" VARCHAR(25), "birthdate" VARCHAR(25), "gender" VARCHAR(25), "nation" VARCHAR(25), "license" VARCHAR(25), "swrid" VARCHAR(25), "clubid" INT, "athleteid" INT NOT NULL,PRIMARY KEY ("athleteid"));
CREATE TABLE db_results.result ("comment" VARCHAR(100), "eventid" VARCHAR(25), "reactiontime" VARCHAR(25), "status" VARCHAR(25), "swimtime" VARCHAR(25), "heatid" VARCHAR(25), "lane" VARCHAR(25), "entrytime" VARCHAR(25), "entrycourse" VARCHAR(25), "athleteid" INT, "points" VARCHAR(25), "resultid" INT NOT NULL,PRIMARY KEY ("resultid"));
CREATE TABLE db_results.split ("distance" VARCHAR(25), "swimtime" VARCHAR(25), "resultid" INT, "splitid" INT NOT NULL,PRIMARY KEY ("splitid"));
-- CREATE TABLE db_results.handicap ("breast" VARCHAR(25), "free" VARCHAR(25), "medley" VARCHAR(25), "athleteid" INT, "handicapid" INT NOT NULL,PRIMARY KEY ("handicapid"));
